  \"2015-01-22T15:25:14.648204\",\n\t\"name\": \"tiger-line-shapefile-2012-series-information-file-for-the-nation-current-tribal-block-group-nat\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then               U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
  MTDB representsn               a seamless national file with no overlaps or gaps
  between parts, however, each TIGER/Line shapefile is designed to stand alone as
  an independent datan               set, or they can be combined to cover the entire
  nation. A tribal block group is a cluster of census tabulation blocks within a single
  tribal censusn               tract delineated by American Indian tribal participants
  or the Census Bureau for the purpose of presenting demographic data on their reservation
  and/orn               off-reservation trust land. The 2010 Census tribal block groups
  are defined independently of the standard county-based block group delineation.
  Forn               federally recognized American Indian Tribes with reservations
  and/or off-reservation trust lands with a population less than 1,200, a single tribal
  blockn               group is defined. Qualifying reservations and/or off-reservation
  trust lands with a population greater than 1,200 could define additional tribal
  blockn               groups within their area without regard to the standard block
  group configuration. For the 2010 Census, tribal block groups do not necessarily
  containn               tabulation blocks always beginning with the same number and
  could contain seemingly duplicate block numbers. For the 2010 Census, tabulation
  blockn               numbers are still assigned only using by standard block group,
  not the tribal block groups. To better identify tribal block groups, the letter
  code rangen               A through K (except I, which could be confused with a
  number 1) is used uniquely within each tribal census tract. For the 2010 Census,
  tribal blockn               groups and tribal census tracts were delineated through
  the Tribal Statistical Areas Praogram (TSAP).\",\n\t\"license_title\": null,\n\t\"extras\":
